window.bookSummaryJSON = "L.M. Montgomery's <i>Rainbow Valley</i> is the continuation of the beloved classics <i>Anne of Green Gables</i> and <i>Anne of Avonlea</i>. <p>Anne and Gilbert Blythe are married and have six mischievous children. Always seeking out new adventures and trying to help others, they're a rambunctious lot.</p> <p>With a charming narration from Barbara Caruso, <i>Rainbow Valley</i> is a playful and enjoyable listening experience.</p>"; 
